def get_price(token_address, token):
    url = f"https://api.dexscreener.com/latest/dex/tokens/{token_address}"
    response = requests.get(url).json()
    print('here')
    if response['pairs'] is None:
        return 0
    for pair in response['pairs']:
        if pair['quoteToken']['address'] == 'So11111111111111111111111111111111111111112':
            zero_for_one = True
            pair_address = pair["pairAddress"]
            ntoken0, ntoken1 = (pair['liquidity']['base'], pair['liquidity']['quote'])
        elif pair['baseToken']['address'] == 'So11111111111111111111111111111111111111112':
            zero_for_one = False
            pair_address = pair["pairAddress"]
            ntoken0, ntoken1 = (pair['liquidity']['base'], pair['liquidity']['quote'])
    pool_key = fetch_pool_keys(pair_address)
    print('there')
    if pool_key is None:
        return 0
    pool_decimal0 = pool_key['base_decimals']
    pool_decimal1 = pool_key['quote_decimals']
    ntoken0 = int(ntoken0 * (10 ** pool_decimal0))
    ntoken1 = int(ntoken1 * (10 ** pool_decimal1))
    return swap_token_amount_base_in(token, ntoken0, ntoken1, zero_for_one)

def get_sol_sum(log:str):
    sol = 0
    for x in log.split(' '):
        token, num = x.split(':')
        num = int(num)
        try:
            sol += int(get_price(token, num))
            print(sol)
        except:
            continue
    
